6	2	4	./02_Slit_Coil_Packaging_Lines_1.jpg	1420	1800	Slit Coil Packaging Lines			<p>&nbsp;&nbsp;&nbsp;</p>
669	2	471	cms_page_media/68/LEF2.JPG	500	1000	Entry and exit work roll gap and roll bend profiles			<p>are displayed on a monitor. Leveler set-up is full automatic based upon mechanical properties, gauge, and incoming strip defects such as center-buckle and edge-wave. Joy-stick override is available for minor Leveler adjustment while running. A set-up memory saves all Leveler settings for future recall, a time saver when running similar coil from specific producers and when coils are split and re-stocked.</p>
670	3	471	cms_page_media/68/LEF3.JPG	500	1000	Except for the roll positioning cylinders			<p>, Leveler Cassettes contain all the working parts of the Leveler including work rolls, back-up flights, back-up bearings, and drive shafts. Cassette Levelers are commonly equipped with two Cassettes, one for thin gauge and one for heavy gauge. Leveling capacity that once required two complete tandem Levelers can be achieved with one Leveler with multiple Cassettes. Cassettes can be 4-Hi, 5-Hi, or 6-Hi for precision leveling carbon steel, aluminum, and bright annealed stainless in one CTL Line. In addition to its expanded product and gauge range, Braner/Loopco Cassette Levelers improve &ldquo;up-time&rdquo; as routine roll cleaning and other regular maintenance duties can be accomplished off-line while the CTL is producing product.</p>
910	466	632	cms_page_media/24/SCPOHERO.JPG	1500	2000	Slit Coil Packaging			<p>Slit coils generated from a Slitting Line are normally sorted by order and packaged eye axis vertical for over the road shipment to the customer. Slit Coil Packaging Systems are employed to safely and efficiently the job of sorting and packaging slit coils.</p>\r\n<p>&nbsp;</p>\r\n<p>Braner/Loopco&rsquo;s earliest Automated Slit Coil Packaging Systems date back to 1956. As a testament to exceptional design and construction, a late 1950s Braner/Loopco Packaging System remains in service today at a Midwest coil processing facility. Since then, Braner/Loopco has produced hundreds of Slit Coil Packaging Systems with state-of-the-art proprietary and patented features designed to safely and efficiently sort and package ferrous and non-ferrous slit coils for coil processors.</p>
5	1	4	./01_Slitting_Lines_1.jpg	2304	3072	Slitting Lines		/slitting-coils	<p>&nbsp;&nbsp;&nbsp;</p>
674	1	473	cms_page_media/83/MUARF1.jpg	500	1000	Loopco Slitter Heads			<p><span style="font-family: Arial;">are manufactured from original Loopco Industries engineering drawings to precise original Loopco tolerances and specifications.&nbsp;&nbsp; </span></p>
911	467	633	cms_page_media/24/SPCO1.jpg	600	600	Turret Stacker			Hi-speed Double-End Turret Stacker automatically stacks 15,000# x 84 OD coils.  The double-end design allows a coil to be picked while a coil is being stacked, which makes the Braner/Loopco Turret Stacker faster than any other style Coil Stacker. 
912	468	633	cms_page_media/24/SPCO2.JPG	600	600	Downender			This Downender picks aluminum and stainless coils off a 4-Arm and automatically lays coils down eye axis vertical on rolls.  The Downending cycle is fully automatic and operatorless.  A Braner/Loopco feature allows the operator to use a bar code reader to enter slit coil widths into the controller rather than punching-in coil dimensions.
913	469	633	cms_page_media/24/SCPO3.jpg	600	600	Packaging Line			This Packaging Line automatically sorts and packages slit coils generated from a 60,000# x 72 x .250 Turret Head Slitting Line.  Slit Coils are automatically downlayed and conveyed to a Strapping Machine that quickly applies multiple radial straps to secure the coil for over the road transport.  A Turret Stacker sorts and stacks the strapped coils. 
675	2	473	cms_page_media/83/MUARF2.jpg	500	1000	Rebuilding			<p><span style="font-family: Arial;">can extend the useful life of old equipment.&nbsp; This 72&rdquo; (1828mm) x 0.250&rdquo; (6.3mm) Roller Leveler ran a steady diet of hot rolled black coil for 20+ years.&nbsp; A total rebuild extended its useful life for many years.</span></p>
8	3	4	./04_Multi-Blanking_Lines.jpg	1536	2048	Multi-Blanking Lines			<p>&nbsp;&nbsp;&nbsp;</p>
44	2	22	./02_Andiamo_Automatic_Hands_Free_Threading.jpg	500	1000	Andiamo automatic hands-free multi-strip threading			
1481	4	471	cms_page_media/68/LEF4_1.jpg	500	1000	TorqueMaster Levelers			<p><span style="font-family: Arial;">are designed and built to produce panel-flat spring-back memory stabilized sheets for downstream lights-out laser cutting.&nbsp; Unlike an ordinary Leveler where all work rolls are driven by a common motor, each TorqueMaster work roll is coupled to its own discrete torque-vectoring drive motor.&nbsp; While an ordinary single motor Leveler&nbsp; has limited roll plunge capacity, TorqueMaster&rsquo;s discrete torque-vector drive can plunge rolls to depths necessary for spring-back memory stabilization without overloading and damaging its drive train.&nbsp;&nbsp; </span></p>
626	3	451	cms_page_media/102/MHE7.jpg	600	600	Coil Tipper			<p>Coil Tippers are used to upend coils 90-degrees from eye axis vertical to eye horizontal and vice-versa. Braner/Loopco Coil Tippers are available in capacities from 5-ton to 20-ton.</p>
87	44	170	./02_Slit_Coil_Packaging_Lines_1_1.jpg	1420	1800	Slit Coil Packaging Lines			
88	45	170	./01_Slitting_Lines_1_1.jpg	2304	3072	Slitting Lines		/slitting-coils	
89	46	170	./04_Multi-Blanking_Lines_1.jpg	1536	2048	Multi-Blanking Lines			
45	3	22	./03_Wireless_Remote_Coil_Car_Operation.jpg	500	1000	Wireless remote Coil Car operation improves safety 			
113	58	185	./02_Andiamo_Automatic_Hands_Free_Threading_1.jpg	500	1000	Andiamo automatic hands-free multi-strip threading			
114	59	185	./01_Compact_Slitting_Line_Footprint_1.jpg	500	1000	1. Compact Slitting LLine foot print			conserves floor space, reduces thread-up time and improves strip tracking
115	60	185	./03_Wireless_Remote_Coil_Car_Operation_1.jpg	500	1000	03 Wireless Remote Coil Car Operation.			
357	113	322	./100_0168_2.JPG	1500	2000	World Leader			 Braner/Loopco has designed and manufactured 600+ ferrous and non-ferrous Coil Slitting Lines that produce high-quality slit coil at metal producing mills, metal service centers, welded tube & pipe manufacturers, building products manufacturers, and metal products OEMs in 24-countries. Braner/Loopco Slitting Lines are processing coils weighing up to 45-tons in gauges from 0.006 (0.18mm) through 0.63 (16.0mm).\r\n\r\nBraner/Loopco Slitting Lines are recognized for producing superior-quality slit coil in an efficient manner regardless of the size of the production run. Exclusive features like laser aided coil centering, quick-change precision Turret Head Slitters, patented threadless tooling lock-up, patented Variable Strip Tensioners, patented non-marking Duplex Tensioners, patented shape-correction Cluster Levelers, and more combine to make Braner/Loopco Slitters the worlds best.\r\n
358	114	323	./IMG_0565_600px_1.jpg	600	600	TITLE			Sitting and rewinding a 20-ton coil into fifty narrow 0.007 (0.18mm) gauge tightly wound straight wall virtually burr-free slit coils requires both precision and finesse. This Turret Head Slitter achieves both.
359	115	323	./100_1860_600px_1.jpg	600	600	TITLE			Sitting and rewinding a 20-ton coil into fifty narrow 0.007 (0.18mm) gauge tightly wound straight wall virtually burr-free slit coils requires both precision and finesse. This Turret Head Slitter achieves both.
861	5	451	cms_page_media/102/MHE5.JPG	600	600	C-Hook			<p>C-Hooks are used to transport master coils as well as slit coil groups. This example is a pair of 30-ton x 72&rdquo; (1828mm) wide C-Hooks with Parking Stands that allow more convenient storage of C-Hooks not in use.</p>
356	1	321	./100_0168_1.JPG	1500	2000	World Leader			<p>Braner/Loopco has designed and manufactured 600+ ferrous and non-ferrous Coil Slitting Lines that produce high-quality slit coil at metal producing mills, metal service centers, welded tube &amp; pipe manufacturers, building products manufacturers, and metal products OEMs in 25-countries. Braner/Loopco Slitting Lines are processing coils weighing up to 45-tons in gauges from 0.003&rdquo; (0.08mm) through 0.750&rdquo; (19.0mm). Braner/Loopco Slitting Lines are recognized for producing superior-quality slit coil in an efficient manner regardless of the size of the production run. Exclusive features like laser aided coil centering, quick-change precision Turret Head&trade; Slitters, patented &ldquo;threadless&rdquo; tooling lock-up, patented Variable Strip Tensioners, patented non-marking Duplex Tensioners, patented shape-correction Cluster Levelers&trade;, and more combine to make Braner/Loopco Slitters the world&rsquo;s best.</p>
1242	7	881	cms_page_media/105/MCE07.jpg	600	600	Cardboard Core Cutter			<p><span style="font-family: Arial;">Core Cutters quickly and efficiently cut cardboard tubes into narrow cores commonly employed to support the ID of thin gauge coils. &nbsp;Core Cutters employ a pneumatic cutter that slices cores to precise widths without generating dust.&nbsp; &ldquo;Operatorless&rdquo; controls can be programmed for 100-different widths and 100-different quantities.</span></p>
1243	8	881	cms_page_media/105/MCE08.jpg	600	600	Guiilotine Crop Shear			<p><span style="font-family: Arial;">Guillotine Crop Shears are employed to crop-off coil heads and tails, and to &lsquo;split&rsquo; coil diameters in coil processing lines.&nbsp; Crop Shears are hydraulic cylinder powered and are available in capacities to 0.750&rdquo; (19.0mm) gauge x 100&rdquo; (2540mm) wide.</span></p>
460	197	378	./01_Compact_Slitting_Line_Footprint_1.jpg	500	1000	1. Compact Slitting LLine foot print			conserves floor space, reduces thread-up time and improves strip tracking
461	198	378	./03_Wireless_Remote_Coil_Car_Operation_1.jpg	500	1000	03 Wireless Remote Coil Car Operation.			
549	2	423	cms_page_media/62/SATWLO3.jpg	600	600	Stainless Traverse Winding Line			<p>This Edge Conditioning &amp; Traverse Winding Line handles from .375&rdquo; (9.5mm) wide through 1.5&rdquo; (38.1mm) coils in gauges to .060&rdquo; (1.52mm) and forms a rolled #4 edge at 1,000 FPM (304 meters/min).&nbsp; A three roll Pulling Bridle generates tension to pull the strip through the edging dies.&nbsp; A butt-welder joins multiple coils to form a 4,000# (1818 Kg) x 12&rdquo; (304mm) traverse wound coil.</p>
