467	1	396	cms_page_media/24/SPCO1.jpg	600	600	Turret Stacker			Hi-speed Double-End Turret Stacker automatically stacks 15,000# x 84 OD coils.  The double-end design allows a coil to be picked while a coil is being stacked, which makes the Braner/Loopco Turret Stacker faster than any other style Coil Stacker. 
