874	4	457	cms_page_media/112/A4.JPG	600	600	Strip Inspection Station			<p>Strip Inspection Stations are utilized by those who process exposed automotive coil. Exposed auto coil is commonly inspected topside and bottom to insure the strip has no surface defects that degrade exterior auto paint. This Strip Inspection Station runs the strip into a tower with high-intensity and strobe lighting that allows an attendant to view the top and bottom surfaces from one point. Strip steering is employed to maintain the strip centerline.</p>
