668	1	471	cms_page_media/68/LEF1.jpg	500	1000	Braner/Loopco Roller Levelers utilize banks of hydraulic cylinders			<p>Braner/Loopco Roller Levelers utilize banks of hydraulic cylinders rather than mechanical sliding wedges and worm screw jacks for roll gap setting and shape-correction roll bending. Cylinders are independently controlled and are fitted with internal linear voltage transducers for position feed-back in increments of 0.001&rdquo; (0.025mm). Independent cylinder control allows for unlimited roll gap and roll bend configurations with zero back-lash, which results in superior shape-correction capabilities.</p>
