1233	4	881	cms_page_media/105/MCE04.jpg	600	600	Rotary Crop Shear			<p><span style="font-family: Arial;">Rotary Shears are installed in coil lines in lieu of guillotine Crop Shears where little space is available.&nbsp; Rotary Shears employ slitter knives installed on a traveling &lsquo;head&rsquo; to slice across the width of a strip.</span></p>
1234	5	881	cms_page_media/105/MCE05.jpg	600	600	Side Trimmer			<p><span style="font-family: Arial;">Side Trimmers are commonly installed in continuous coil processing lines (pickle lines, coil coating lines) and CTL Lines to produce an accurate finished strip width.&nbsp; Rotary slitting knives are mounted on stub arbors installed in side adjustable Trimmer Heads that are set to a specific strip width.</span></p>
1235	6	881	cms_page_media/105/MCE06.jpg	600	600	ID Skid Lifter			<p><span style="font-family: Arial;">ID Skid Lifters are used for efficient overhead crane handling of skidded coil stacks.&nbsp; Skid Lifters stack skidded coils in a finished goods storage area, and are used in lieu of a fork truck to load skidded coils onto a truck via overhead crane.&nbsp; Skid Lifter shoes grip secure skidded coils from the ID.&nbsp; Gripping and release are hands-free.</span></p>
1411	617	987	cms_page_media/112/AHERO.JPG	1500	2000	Uncoiler Filler Plates			<p>These Uncoiler Fillers are profiled lightweight plastic bars that bolt onto an Uncoiler drum to increase the range of coil IDs handled by the Uncoiler. Benefits of Lightweight Plastic Fillers include the ease of handling without a crane and the fact they expand with the Uncoiler drum.</p>
1412	618	988	cms_page_media/112/A1.JPG	600	600	Recoiler Filler Plates			<p>Recoiler Filler Plates are employed to produce slit coil IDs larger than the base Recoiler drum diameter. A common Recoiler Filler Plate size is 24&rdquo; (609mm) diameter for bolting onto a base 20&rdquo; (508mm) diameter drum. Recoiler Fillers are available in lightweight plastic for gauges up to .135&rdquo; (3.4mm). Heavier gauges require heat-treated steel Fillers. A Braner/Loopco exclusive is a &ldquo;Speed-Load&rdquo; feature that allows Fillers to be installed or removed in one-minute.</p>
1413	619	988	cms_page_media/112/A2.jpg	600	600	Tail Hold-Downs			<p>Recoiler Tail Hold-Downs make the job of OD banding coils safer and easier. Adjustable polyurethane hold-down pads positioned by a pair of hydraulic cylinders emerge from the Overarm Separator and snub the coil tails to prevent them from sliding out and clock-springing.</p>
1414	620	988	cms_page_media/112/A3.JPG	600	600	Belt Wrapper			<p>Belt Wrappers attach the head end of a coil onto the Recoiler drum without having to stick the strip into the drum gripper bar. Belt Wrappers are commonly installed in continuous process lines such as paint lines and galvanize lines where stopping the line to hook-up a coil is impractical. This example wraps 72&rdquo; (1828mm) wide strip up to .075&rdquo; (1.9mm) coil onto the Recoiler drum for over or under winding</p>
1415	621	988	cms_page_media/112/A4.JPG	600	600	Strip Inspection Station			<p>Strip Inspection Stations are utilized by those who process exposed automotive coil. Exposed auto coil is commonly inspected topside and bottom to insure the strip has no surface defects that degrade exterior auto paint. This Strip Inspection Station runs the strip into a tower with high-intensity and strobe lighting that allows an attendant to view the top and bottom surfaces from one point. Strip steering is employed to maintain the strip centerline.</p>
607	1	442	cms_page_media/82/MUROHERO1.jpg	1500	2000	Line Upgrades			<p>An example of a successful coil system upgrade is this 24&rdquo; (609mm) wide Slitting Line that struggled to produce close tolerance straight-wall slit quality coils that OEM customers demand.&nbsp; This 40-year old pull-through line was transformed into a precision loop Slitting Line that includes a new precision Turret Head&trade;, new tensioning equipment, and upgraded controls.&nbsp; The original Uncoiler, Recoiler, Overarm, and coil loading and unloading equipment were rebuilt and re-installed, which resulted in significant cost savings</p>
1475	634	1108	cms_page_media/39/CTLF1.jpg	500	1000	Precision Cassette Levelers			<p><span style="font-family: Arial;">produce panel-flat sheets and blanks through a wide gauge and mechanical property range by means of quick-change Leveler Cassettes.&nbsp; Hydraulic roll positioning, automatic Leveler set-up, built-in set-up memory, automatic Leveler calibration, and TorqueMaster deep plunge ability for laser quality memory-stabilized products are Cassette Leveler features.</span></p>
