615	1	446	cms_page_media/92/LPOFSHERO.jpg	1500	2000	Order Filling Station			<p>Braner/Loopco Long Products Order Filling Stations are designed to efficiently handle, sort, and package a full array of long products such as angles, channels, tubing, rounds, and flat bars. Order Filling Stations allow an attendant to handle bulky products safely and efficiently and fill more orders than can be accomplished with saw horses and muscle. Order Filling Stations commonly fill 80 to 120 orders per shift safely with minimal physical exertion.</p>\r\n<p>&nbsp;</p>\r\n<p>What sets Braner/Loopco Order Filling Stations apart from all others is &ldquo;ruggedness&rdquo;. Filling long products orders is usually tough on equipment because the product is often rolled, dropped, and banged onto and into the Order filling Station components. Braner/Loopco Order Filling Stations are built heavy to absorb regular shock loads without damage that requires down-time to affect repairs and replacements.</p>
