1192	546	860	./100_0168.JPG	1500	2000	World Leader			<p>Braner/Loopco has designed and manufactured 600+ ferrous and non-ferrous Coil Slitting Lines that produce high-quality slit coil at metal producing mills, metal service centers, welded tube &amp; pipe manufacturers, building products manufacturers, and metal products OEMs in 25-countries. Braner/Loopco Slitting Lines are processing coils weighing up to 45-tons in gauges from 0.003&rdquo; (0.08mm) through 0.750&rdquo; (19.0mm). Braner/Loopco Slitting Lines are recognized for producing superior-quality slit coil in an efficient manner regardless of the size of the production run. Exclusive features like laser aided coil centering, quick-change precision Turret Head&trade; Slitters, patented &ldquo;threadless&rdquo; tooling lock-up, patented Variable Strip Tensioners, patented non-marking Duplex Tensioners, patented shape-correction Cluster Levelers&trade;, and more combine to make Braner/Loopco Slitters the world&rsquo;s best.</p>
1193	547	861	./IMG_0157_600px.jpg	600	600	Thin Gauge			<p>Sitting and rewinding a 20-ton coil into fifty narrow 0.007&rdquo; (0.18mm) gauge tightly wound straight wall virtually burr-free slit coils requires both precision and finesse. This Turret Head&trade; Slitter achieves both.</p>
1194	548	861	./100_1860_600px.jpg	600	600	Heavy Gauge			<p>45-ton x .625&rdquo; (16.0mm) gauge coils in widths to 84&rdquo; (2133mm) is the capacity of this Turret Head&trade; Slitter that generates 35,000 tons/month of slit coil to satisfy the appetite of heavy-wall OCTG welded tube mills.</p>
1195	549	861	./Marubeni_3_60Kx72x.135_600_px.jpg	600	600	Exposed Automotive			<p>Coils destined for exposed automotive applications is a high-quality and surface sensitive product. Surface inspection is required to assure that the product quality meets stringent quality standards. This &ldquo;double-loop&rdquo; Turret Head&trade; Slitter is dedicated to processing 30-ton x 72&rdquo; (1828mm) wide exposed automotive coil.</p>
1196	550	861	./100_0455_600px.jpg	600	600	Inspection			<p>This Inspection/Slitting Line is designed for top and bottom surface inspection while producing full width or side-trimmed coil. A unique four roll Inspection Tower elevates the strip 120&rdquo; (3050mm) above the pass line to expose the top and bottom strip surfaces for visual inspection.</p>
1197	551	861	cms_page_media/7/SL5A.jpg	600	600	Bar Grating			<p>Slitting .187&rdquo; thick material into sixty narrow coils requires heavy duty equipment. This &ldquo;single-loop&rdquo; Turret Head&trade; Slitter raises the bar for productivity and efficiency for a manufacturer of bar grating panels</p>
1198	552	861	./Magic60Kx72x125-02_600_px.jpg	600	600	Painted			<p>This &ldquo;Double-Loop&rdquo; Turret Head&trade; Slitting Line processes thin gauge painted coil at a coil processing center. A non-marking &ldquo;Belt-Bridle&rdquo; Tensioner is employed to generate rewind tension with no surface damage.</p>
587	1	437	cms_page_media/67/LEO1A.jpg	600	600	1/2" x 72" Wide Stretch Leveler			<p><span style="font-family: Arial;">This 72&rdquo; (1828mm) wide x 0.500&rdquo; (12.7mm) gauge <span style="text-decoration: underline;">Stretch Leveler</span> produces panel-flat memory-free sheet and plate from hi-strength hot-rolled coil.&nbsp; Non-marking grippers and real-time graphic stretch display and elongation results assure the production of premium quality products.&nbsp; Unique &ldquo;LEGO&rdquo; style Stretcher frame construction reduces shipping and installation time and cost by employing properly designed bolt-together structural members instead of an oversize and overweight frame that requires special shipping permits and on-site mobile cranes for unloading and installation.&nbsp;&nbsp;</span></p>
1360	596	970	cms_page_media/113/OA02.jpg	1500	2000	Common Sizes			<p><span style="font-family: Arial;">The most common Braner/Loopco Overarm and Underarm Separator Tooling is 7.0&rdquo; (177.8mm) OD x 3.5&rdquo; (88.9mm) ID x .062&rdquo; (1.57mm) and .125&rdquo; (3.17mm) thick with a 1.25&rdquo; (31.75mm) double bevel.&nbsp; Those Separator Discs are shipped from inventory in two days from order. &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>
1361	597	970	cms_page_media/113/OA01.jpg	1243	2000	Overarm and Underarm Tooling			<p><span style="font-family: Arial;">Braner/Loopco Overarm and Underarm Separator Tooling is the highest quality available from any source.&nbsp; Raw SAE 52100 tool steel blanks are rough machined, heat-treated to Rc 48-50 for toughness and wear resistance, and finish machined to 16-32 RMS finish.&nbsp; Our tooling is employed on 600+ Braner/Loopco Overarm Separators and Tensioner Underarm Separators around the globe.</span></p>
1362	598	970	cms_page_media/113/OA03.jpg	1500	2468	Overam Spacers			<p>Overarm &amp; Tension Stand Separator &ldquo;Spacers&rdquo;, like Separator Discs, are manufactured to exacting specifications and suited for slitting thin-gauge surface-critical coil and heavy-gauge hot band.&nbsp; Spacers are available in high-quality rugged natural canvas cloth phenolic or heavy-duty nylon.&nbsp; Phenolic or nylon tubing is saw cut into raw blanks, precision machined ID and OD, and face machined to precise thickness tolerances.&nbsp; Standard Spacer thickness are: .031&rdquo;, .062&rdquo;, .125&rdquo;, .250&rdquo;, .500&rdquo;, 1.000&rdquo;, 2.000&rdquo;, and 4.000&rdquo;.&nbsp; OD banding grooves van be machined into 2&rdquo; and wider Spacers upon request.&nbsp;</p>
462	1	390	cms_page_media/24/SCPOHERO.JPG	1500	2000	Slit Coil Packaging			<p>Slit coils generated from a Slitting Line are normally sorted by order and packaged eye axis vertical for over the road shipment to the customer. Slit Coil Packaging Systems are employed to safely and efficiently the job of sorting and packaging slit coils.</p>\r\n<p>&nbsp;</p>\r\n<p>Braner/Loopco&rsquo;s earliest Automated Slit Coil Packaging Systems date back to 1956. As a testament to exceptional design and construction, a late 1950s Braner/Loopco Packaging System remains in service today at a Midwest coil processing facility. Since then, Braner/Loopco has produced hundreds of Slit Coil Packaging Systems with state-of-the-art proprietary and patented features designed to safely and efficiently sort and package ferrous and non-ferrous slit coils for coil processors.</p>
1494	645	1125	cms_page_media/83/MUARF1.jpg	500	1000	Loopco Slitter Heads			<p><span style="font-family: Arial;">are manufactured from original Loopco Industries engineering drawings to precise original Loopco tolerances and specifications.&nbsp;&nbsp; </span></p>
1495	646	1125	cms_page_media/83/MUARF2.jpg	500	1000	Rebuilding			<p><span style="font-family: Arial;">can extend the useful life of old equipment.&nbsp; This 72&rdquo; (1828mm) x 0.250&rdquo; (6.3mm) Roller Leveler ran a steady diet of hot rolled black coil for 20+ years.&nbsp; A total rebuild extended its useful life for many years.</span></p>
608	1	443	cms_page_media/82/MURO1_1.JPG	600	600	CTL Line Upgrade			<p>The mission was to improve the performance and length tolerance on an old 60&rdquo; (1524mm) wide x .125&rdquo; (3.2mm) gauge &ldquo;hump table&rdquo; CTL line used to produce stainless steel sheets. The hump table and positive-stop length measuring apparatus was removed in favor of this Precision Servo Feed. The Servo Feed featured non-marking feed rolls and a 20 kW AC Servo drive with touch-screen length and batch count input. Productivity was doubled with plus/minus .010&rdquo; (0.25mm) length tolerance parts.</p>
609	2	443	cms_page_media/82/MURO2.jpg	600	600	Tube Mill Upgrade			<p>The mission was to improve the output of a welded tube mill. Re-tooling the tube mill was taking time away from production as the mill was down during re-tooling. A common upgrade is to &ldquo;raft&rdquo; mill stands where several stands are mounted to a plate that is crane removed and exchanged with re-tooled stands. But with no crane available rafting the stands was not feasible. The solution was to build four (4) Turret Head&trade; mill stands that could change mill tooling without having to lift the stands off the mill base. As with Turret Head&trade; Slitters, the stands produce product while the opposite heads are re-tooled.</p>
1231	2	881	cms_page_media/105/MCE02.jpg	600	600	PVC Laminator			<p><span style="font-family: Arial;">PVC Laminators apply surface protection PVC film to strip passing through the Laminator.&nbsp; Surface-critical coil such as bright stainless steel, aluminum, and pre-painted coil surfaces are commonly protected by laminated PVC film.</span></p>
1232	3	881	cms_page_media/105/MCE03.jpg	600	600	Belt Wrapper			<p><span style="font-family: Arial;">Belt Wrappers automatically wrap strip around the Recoiler drum as the strip is traveling.&nbsp; Belt Wrappers are commonly installed in coil coating lines where moving strip must be attached to the Recoiler in seconds.&nbsp; Belt Wrappers are also employed installed in exposed automotive Coil Inspection Lines where Recoiler drum gripper &ldquo;bumps&rdquo; are forbidden.</span></p>
31	1	16	./100_0168.JPG	1500	2000	World Leader			<p>Braner/Loopco has designed and manufactured 600+ ferrous and non-ferrous Coil Slitting Lines that produce high-quality slit coil at metal producing mills, metal service centers, welded tube &amp; pipe manufacturers, building products manufacturers, and metal products OEMs in 25-countries. Braner/Loopco Slitting Lines are processing coils weighing up to 45-tons in gauges from 0.003&rdquo; (0.08mm) through 0.750&rdquo; (19.0mm). Braner/Loopco Slitting Lines are recognized for producing superior-quality slit coil in an efficient manner regardless of the size of the production run. Exclusive features like laser aided coil centering, quick-change precision Turret Head&trade; Slitters, patented &ldquo;threadless&rdquo; tooling lock-up, patented Variable Strip Tensioners, patented non-marking Duplex Tensioners, patented shape-correction Cluster Levelers&trade;, and more combine to make Braner/Loopco Slitters the world&rsquo;s best.</p>
610	3	443	cms_page_media/82/MURO3.JPG	600	600	Variable Rake Hydraulic Shear Retrofit			<p>A 1950s vintage 84&rdquo; (2133mm) x .500&rdquo; (12.7mm) gauge hot rolled steel CTL was equipped with a worn and slow mechanical Shear and Sheet Piler that required repairs almost daily. The mission was to replace the old mechanical Shear and Piler with new reliable equipment that fit an existing foot print as the rest of the CTL was to remain in-place. Machine down-time for the conversion was critical because this was the only heavy CTL Line operating in the plant. The solution was to replace the mechanical Shear with a new Variable Rake Hydraulic Shear and a &ldquo;drop style&rdquo; Stacker.</p>
343	1	34	cms_page_media/17/VIP3.jpg	400	1000	Equipment Support Services			<p>This Roller Leveler is being serviced at a company's plant 2,000-miles from Braner/Loopco.&nbsp; The customer is employing a WiFi connected iPod for visual and audio communication with a Braner VIP Technician who is supervising assembly in real-time from Braner/Loopco's office.</p>
1199	1	862	cms_page_media/63/TWLF01.jpg	1500	2000	Traverse Winding Lines			<p>An example of an engineered purpose-built Traverse Winding System is this Traverse Winder/Rolling Mill designed to produce narrow ladies' hairpin stock from flat wire.&nbsp; SAE 1090 wire coil is unwound and rolled into flat wire by a 2-Hi Rolling Mill equipped with water cooled carbide rolls.&nbsp; A dancer assembly creates precise winding tension in order to produce traverse wound flat wire coils on a spool at 2,000 FPM (610 meters/min).&nbsp; The Winder traverses on machine tool anti-friction slides with traverse power provided by AC servo motor.</p>
1522	654	1158	cms_page_media/82/MUROHERO1.jpg	1500	2000	Line Upgrades			<p>An example of a successful coil system upgrade is this 24&rdquo; (609mm) wide Slitting Line that struggled to produce close tolerance straight-wall slit quality coils that OEM customers demand.&nbsp; This 40-year old pull-through line was transformed into a precision loop Slitting Line that includes a new precision Turret Head&trade;, new tensioning equipment, and upgraded controls.&nbsp; The original Uncoiler, Recoiler, Overarm, and coil loading and unloading equipment were rebuilt and re-installed, which resulted in significant cost savings</p>
1523	655	1159	cms_page_media/82/MURO1_1.JPG	600	600	CTL Line Upgrade			<p>The mission was to improve the performance and length tolerance on an old 60&rdquo; (1524mm) wide x .125&rdquo; (3.2mm) gauge &ldquo;hump table&rdquo; CTL line used to produce stainless steel sheets. The hump table and positive-stop length measuring apparatus was removed in favor of this Precision Servo Feed. The Servo Feed featured non-marking feed rolls and a 20 kW AC Servo drive with touch-screen length and batch count input. Productivity was doubled with plus/minus .010&rdquo; (0.25mm) length tolerance parts.</p>
1524	656	1159	cms_page_media/82/MURO2.jpg	600	600	Tube Mill Upgrade			<p>The mission was to improve the output of a welded tube mill. Re-tooling the tube mill was taking time away from production as the mill was down during re-tooling. A common upgrade is to &ldquo;raft&rdquo; mill stands where several stands are mounted to a plate that is crane removed and exchanged with re-tooled stands. But with no crane available rafting the stands was not feasible. The solution was to build four (4) Turret Head&trade; mill stands that could change mill tooling without having to lift the stands off the mill base. As with Turret Head&trade; Slitters, the stands produce product while the opposite heads are re-tooled.</p>
1525	657	1159	cms_page_media/82/MURO3.JPG	600	600	Variable Rake Hydraulic Shear Retrofit			<p>A 1950s vintage 84&rdquo; (2133mm) x .500&rdquo; (12.7mm) gauge hot rolled steel CTL was equipped with a worn and slow mechanical Shear and Sheet Piler that required repairs almost daily. The mission was to replace the old mechanical Shear and Piler with new reliable equipment that fit an existing foot print as the rest of the CTL was to remain in-place. Machine down-time for the conversion was critical because this was the only heavy CTL Line operating in the plant. The solution was to replace the mechanical Shear with a new Variable Rake Hydraulic Shear and a &ldquo;drop style&rdquo; Stacker.</p>
578	1	432	cms_page_media/67/LEOHERO1.jpg	1500	2000				<p><span style="font-family: Arial;"><span style="text-decoration: underline;">Precision Levelers</span> convert flat rolled coil into <span style="text-decoration: underline;">panel-flat shape-corrected strip</span> that is further processed downstream into cut sheets, blanks, and plates, or rewound into shape-corrected coil.&nbsp; The difference between a Precision Leveler and a Straightener is the Precision Leveler&rsquo;s ability to eliminate strip shape defects such as wavy-edge and center-buckle, and stabilize or eliminate spring-back caused by trapped internal stresses.&nbsp; </span></p>\r\n<p>&nbsp;</p>\r\n<div>\r\n<p><span style="font-family: Arial;">Braner/Loopco manufactures <span style="text-decoration: underline;">Roller Levelers</span> and <span style="text-decoration: underline;">Stretch Levelers</span> with unique capabilities and qualities that enhance leveling ability and performance.&nbsp; Braner/Loopco&rsquo;s Precision Roller Levelers employ direct acting microprocessor controlled hydraulic cylinders instead of mechanical wedges and gearing for roll positioning.&nbsp; Quick-change roll <span style="text-decoration: underline;">Cassettes</span> with larger and smaller rolls expand gauge and product range beyond an ordinary Leveler&rsquo;s capacity, and multi-motor &ldquo;<span style="text-decoration: underline;">TorqueMaster</span>&rdquo; employs deep plunge for spring-back memory stabilization for laser cutting applications.&nbsp; Braner/Loopco&rsquo;s <span style="text-decoration: underline;">Stretch Leveler</span> produces a real-time yield stretch display to verify elongation beyond elastic limits, and unique &ldquo;LEGO&rdquo; construction reduces Stretcher shipping and installation costs.&nbsp;&nbsp; &nbsp;&nbsp;</span></p>\r\n</div>
1530	662	1162	cms_page_media/102/MHEHERO1.jpg	1500	2000				<p><span style="font-family: Arial;">Coil processing systems are comprised of a series of stand-alone machines, each designed to perform a specific task in the system.&nbsp; Miscellaneous stand-alone machines based on proven time tested machine designs are available from Braner/Loopco.&nbsp;</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-family: Arial;"> On the left is an example of a Belt Wrapper commonly found in continuous strip processing lines such as paint lines and galvanizing lines where stopping the strip to hook-up with the Recoiler is not possible.&nbsp; This over &amp; under wind Belt Wrapper automatically wraps 72&rdquo; (1828mm) wide x 0.075&rdquo; (1.9mm) gauge strip onto a Recoiler without stopping the strip.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>
1531	663	1163	cms_page_media/102/MHE1.jpg	600	600	Coil Transfer Car			<p>Coil Transfer Cars are essentially heavy rail cars designed to transport coils from crane bay to crane bay. Braner/Loopco Coil Transfer Cars are available for handling coils up to 45-tons with one, two, and three coil saddles. Travel power options are electric motor and cable reel or unlimited travel propane engine power</p>
1532	664	1163	cms_page_media/102/MHE2.JPG	600	600	Propane Coil Car			<p>Another style Transfer Car is able to travel and lift a coil onto a Horn or Uncoiler. This Car is equipped with a propane engine that allows unlimited travel with no cable. Braner/Loopco Transfer Cars are equipped with wireless controls.</p>
1533	665	1163	cms_page_media/102/MHE7.jpg	600	600	Coil Tipper			<p>Coil Tippers are used to upend coils 90-degrees from eye axis vertical to eye horizontal and vice-versa. Braner/Loopco Coil Tippers are available in capacities from 5-ton to 20-ton.</p>
1534	666	1163	cms_page_media/102/MHE4.JPG	600	600	Scissor Coil Car w/ Blocker Rolls			<p>Scissor Coil Cars are available in capacities to 45-tons. This Scissor Car is equipped with power &ldquo;blocker rolls&rdquo; that will rotate a coil to position the coil tail for OD banding.</p>
1535	667	1163	cms_page_media/102/MHE5.JPG	600	600	C-Hook			<p>C-Hooks are used to transport master coils as well as slit coil groups. This example is a pair of 30-ton x 72&rdquo; (1828mm) wide C-Hooks with Parking Stands that allow more convenient storage of C-Hooks not in use.</p>
1536	668	1163	cms_page_media/102/MHE6.jpg	600	600	Sheet Lifter			<p>Sheet lifers transport packages of sheets and blanks.&nbsp; This 10-ton x 72" (1828mm) sheet lifter handles sheets to 180" (4572mm) long.</p>
588	2	437	cms_page_media/67/LEO2.jpg	600	600	1/4" x 72" Wide Leveler			<p>72&rdquo; (1828mm) wide Cassette Leveler has capacity to level stainless and carbon steel coil in gauges from .024&rdquo; (0.60mm) through .250&rdquo; (6.3mm) utilizing two exchangeable Cassettes.&nbsp; The heavy Cassette is fitted with 3.000&rdquo; (76.2mm) x 17-rolls, and the light Cassette has 1.750&rdquo; (44.45mm) x 17-rolls.&nbsp; A Power Cassette Injector swaps Cassettes in less than five-minutes.</p>\r\n<p>&nbsp;</p>
1545	669	1176	cms_page_media/67/LEOHERO1.jpg	1500	2000				<p><span style="font-family: Arial;"><span style="text-decoration: underline;">Precision Levelers</span> convert flat rolled coil into <span style="text-decoration: underline;">panel-flat shape-corrected strip</span> that is further processed downstream into cut sheets, blanks, and plates, or rewound into shape-corrected coil.&nbsp; The difference between a Precision Leveler and a Straightener is the Precision Leveler&rsquo;s ability to eliminate strip shape defects such as wavy-edge and center-buckle, and stabilize or eliminate spring-back caused by trapped internal stresses.&nbsp; </span></p>\r\n<p>&nbsp;</p>\r\n<div>\r\n<p><span style="font-family: Arial;">Braner/Loopco manufactures <span style="text-decoration: underline;">Roller Levelers</span> and <span style="text-decoration: underline;">Stretch Levelers</span> with unique capabilities and qualities that enhance leveling ability and performance.&nbsp; Braner/Loopco&rsquo;s Precision Roller Levelers employ direct acting microprocessor controlled hydraulic cylinders instead of mechanical wedges and gearing for roll positioning.&nbsp; Quick-change roll <span style="text-decoration: underline;">Cassettes</span> with larger and smaller rolls expand gauge and product range beyond an ordinary Leveler&rsquo;s capacity, and multi-motor &ldquo;<span style="text-decoration: underline;">TorqueMaster</span>&rdquo; employs deep plunge for spring-back memory stabilization for laser cutting applications.&nbsp; Braner/Loopco&rsquo;s <span style="text-decoration: underline;">Stretch Leveler</span> produces a real-time yield stretch display to verify elongation beyond elastic limits, and unique &ldquo;LEGO&rdquo; construction reduces Stretcher shipping and installation costs.&nbsp;&nbsp; &nbsp;&nbsp;</span></p>\r\n</div>
1546	670	1177	cms_page_media/67/LEO1A.jpg	600	600	1/2" x 72" Wide Stretch Leveler			<p><span style="font-family: Arial;">This 72&rdquo; (1828mm) wide x 0.500&rdquo; (12.7mm) gauge <span style="text-decoration: underline;">Stretch Leveler</span> produces panel-flat memory-free sheet and plate from hi-strength hot-rolled coil.&nbsp; Non-marking grippers and real-time graphic stretch display and elongation results assure the production of premium quality products.&nbsp; Unique &ldquo;LEGO&rdquo; style Stretcher frame construction reduces shipping and installation time and cost by employing properly designed bolt-together structural members instead of an oversize and overweight frame that requires special shipping permits and on-site mobile cranes for unloading and installation.&nbsp;&nbsp;</span></p>
1547	671	1177	cms_page_media/67/LEO2.jpg	600	600	1/4" x 72" Wide Leveler			<p>72&rdquo; (1828mm) wide Cassette Leveler has capacity to level stainless and carbon steel coil in gauges from .024&rdquo; (0.60mm) through .250&rdquo; (6.3mm) utilizing two exchangeable Cassettes.&nbsp; The heavy Cassette is fitted with 3.000&rdquo; (76.2mm) x 17-rolls, and the light Cassette has 1.750&rdquo; (44.45mm) x 17-rolls.&nbsp; A Power Cassette Injector swaps Cassettes in less than five-minutes.</p>\r\n<p>&nbsp;</p>
1548	672	1177	cms_page_media/67/LEO3.JPG	600	600	1/2" x 72" Wide Leveler			<p>72&rdquo; (1828mm) wide Cassette Leveler processes hot-rolled and cold-rolled carbon steel coil in gauges ranging from .075&rdquo; (1.9mm) through .500&rdquo; (12.7mm) gauge. Full automatic set-up, full automatic calibration, and off-line work roll, drive shaft, and back-up maintenance is accomplished while the CTL Line is operating with the second Cassette.</p>
