35	<p></p>\n<p></p>\n<p></p>\n<p><img height="100" alt="" width="100" src="/media/filer_public_thumbnails/filer_public/2014/01/21/wifi.png__100x100_q85_crop_upscale.jpg" style="float: right;"></p>\n<p></p>\n<p></p>\n<p></p>\n<p>"<span style="text-decoration: underline;">Virtual In-Plant</span>" Technical Support <strong>(VIP Tech Support) </strong>is a Braner/Loopco service provided to its customers that addresses lost production time related to equipment trouble or operational issues for which outside technical assistance is required. Rather than lose hours or days of production awaiting on-site tech service, VIP Tech Support <em>"<span style="text-decoration: underline;">virtually</span>" </em>puts expert Braner/Loopco technicians and engineers <span style="text-decoration: underline;">on-site, at your side</span> anywhere in the world in a matter of minutes to help resolve an equipment or operational issue.</p>\n<p></p>\n<p>Utilizing <span style="text-decoration: underline;">SKYPE</span> a popular free internet video conferencing resource and your iPod or smart phone, you can show us your equipment or operational issue in real-time while you explain what's happening. Real-time two-way streaming audio-video conferencing between you and your iPod or smart phone and <strong>our </strong>video conference computers puts a Braner/Loopco technician in your plant at your side where together we can see your equipment and speak as we help diagnose and resolve your trouble.</p>\n<p></p>\n<p>With <span style="text-decoration: underline;">VIP Tech Support's</span> real-time two-way streaming audio and visual communication, time lost exchanging phone calls, e-mails, and photographs, or days lost to scheduling an on-site service trip could be avoided. From Braner/Loopco's office, a VIP Tech can watch work being done while communicating remedial instructions in real-time.</p>\n<p></p>\n<p></p>
52	<p><strong><span style="font-size: 10pt;"><span style="font-family: Arial;">Braner/Loopco supports its customers with on-site field service and replacement parts and components. Support Service for the following brands is available from Braner/Loopco:</span></span></strong></p>\n<p></p>
9	<p></p>\n<h3 class="MsoNormal" style="text-align: justify;">Welcome To Braner</h3>\n<p class="MsoNormal" style="text-align: justify;">Braner/Loopco is an internationally recognized specialist in the design, construction, installation, training, and on-site support of ultra-precision high-performance flat rolled coil processing and automated coil handling systems. With a history of prolific innovation and achievement that originated in 1956, Braner/Loopco has earned a stellar reputation for building bullet-proof reliable state-of-the-art ferrous and non-ferrous Coil Slitting Systems, Precision Cut-to-Length/Blanking Systems, Precision Roller Levelers, Precision Stretch Levelers, Automated Slit Coil Packaging Systems, Precision Oscillate Coil Systems, Precision Strip Rolling Systems, and highly engineered purpose-specific flat rolled strip processing equipment.</p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">Today there are more than 750 Braner/Loopco coil systems operating in 25-countries producing exceptional quality products from ferrous and non-ferrous flat rolled coil. Coil processing capacities range from 0.003 (0.08mm) gauge 0-temper aluminum fin stock coil to 0.750 (19.0mm) gauge high-strength hot-rolled OCTG carbon steel coil, with coil weight capacities ranging up to 45-ton and coil widths to 120 (3048mm). Braner/Loopco coil systems process carbon steel, brass, copper, aluminum, stainless, grain-oriented silicon steels, lead, clad bi-metal, special non-metallic strip, and super alloy coil to precise width, length, and gauge tolerances. </p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">Braner/Loopco coil systems are the product of continuously evolving development and improvement, all aimed at providing the user with superior product quality, exceptional performance with bullet-proof reliability. Braner/Loopco coil systems are based on proven technology and time-tested designs augmented with unique state-of-the-art performance enhancing elements and apparatus developed from dozens of patents its been awarded relating to Sitting, Cut-to-Length, Leveling, and Coil Handling products.</p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">The strength of Braner/Loopco lies in the extensive experience, know-how, and dedication of its people to equipment performance and customer satisfaction. Engineers, designers, technicians, and trade craftsmen, all with decades of experience and an obsessive focus on ultimate satisfaction of Braner/Loopco equipment users, coordinate and collaborate to produce the worlds finest quality coil processing systems supported by the most talented customer service technicians in the industry.</p>
985	<p></p>\n<h3 class="MsoNormal" style="text-align: justify;">Welcome To Braner</h3>\n<p class="MsoNormal" style="text-align: justify;">Braner/Loopco is an internationally recognized specialist in the design, construction, installation, training, and on-site support of ultra-precision high-performance flat rolled coil processing and automated coil handling systems. With a history of prolific innovation and achievement that originated in 1956, Braner/Loopco has earned a stellar reputation for building bullet-proof reliable state-of-the-art ferrous and non-ferrous Coil Slitting Systems, Precision Cut-to-Length/Blanking Systems, Precision Roller Levelers, Precision Stretch Levelers, Automated Slit Coil Packaging Systems, Precision Oscillate Coil Systems, Precision Strip Rolling Systems, and highly engineered purpose-specific flat rolled strip processing equipment.</p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">Today there are more than 750 Braner/Loopco coil systems operating in 25-countries producing exceptional quality products from ferrous and non-ferrous flat rolled coil. Coil processing capacities range from 0.003 (0.08mm) gauge 0-temper aluminum fin stock coil to 0.750 (19.0mm) gauge high-strength hot-rolled OCTG carbon steel coil, with coil weight capacities ranging up to 45-ton and coil widths to 120 (3048mm). Braner/Loopco coil systems process carbon steel, brass, copper, aluminum, stainless, grain-oriented silicon steels, lead, clad bi-metal, special non-metallic strip, and super alloy coil to precise width, length, and gauge tolerances. </p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">Braner/Loopco coil systems are the product of continuously evolving development and improvement, all aimed at providing the user with superior product quality, exceptional performance with bullet-proof reliability. Braner/Loopco coil systems are based on proven technology and time-tested designs augmented with unique state-of-the-art performance enhancing elements and apparatus developed from dozens of patents its been awarded relating to Sitting, Cut-to-Length, Leveling, and Coil Handling products.</p>\n<p style="text-align: justify;"></p>\n<p style="text-align: justify;">The strength of Braner/Loopco lies in the extensive experience, know-how, and dedication of its people to equipment performance and customer satisfaction. Engineers, designers, technicians, and trade craftsmen, all with decades of experience and an obsessive focus on ultimate satisfaction of Braner/Loopco equipment users, coordinate and collaborate to produce the worlds finest quality coil processing systems supported by the most talented customer service technicians in the industry.</p>
