5904	682	9	9	21	json	[{"pk": 9, "model": "text.text", "fields": {"body": "\\n&lt;html&gt;\\n&lt;head&gt;\\n&lt;/head&gt;\\n&lt;body&gt;\\n<p>\\u00a0</p>\\n<h3 class=\\"MsoNormal\\" style=\\"text-align: justify;\\">Welcome To Braner\\u00a0</h3>\\n<p class=\\"MsoNormal\\" style=\\"text-align: justify;\\">Braner/Loopco is an internationally recognized specialist in the design, construction, installation, training, and on-site support of ultra-precision high-performance flat rolled coil processing and automated coil handling systems.\\u00a0 With a history of prolific innovation and achievement that originated in 1956, Braner/Loopco has earned a stellar reputation for building bullet-proof reliable state-of-the-art ferrous and non-ferrous Coil Slitting Systems, Precision Cut-to-Length/Blanking Systems, Precision Roller Levelers, Precision Stretch Levelers, Automated Slit Coil Packaging Systems, Precision Oscillate Coil Systems, Precision Strip Rolling Systems, and highly engineered purpose-specific flat rolled strip processing equipment.</p>\\n<p>\\u00a0</p>\\n<p>Today there are more than 750 Braner/Loopco coil systems operating in 25-countries producing exceptional quality products from ferrous and non-ferrous flat rolled coil.\\u00a0 Coil processing capacities range from 0.003\\u201d (0.08mm) gauge 0-temper aluminum fin stock coil to 0.750\\u201d (19.0mm) gauge high-strength hot-rolled OCTG carbon steel coil, with coil weight capacities ranging up to 45-ton and coil widths to 120\\u201d (3048mm).\\u00a0 Braner/Loopco coil systems process carbon steel, brass, copper, aluminum, stainless, grain-oriented silicon steels, lead, clad bi-metal, special non-metallic strip, and super alloy coil to precise width, length, and gauge tolerances.\\u00a0 \\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0\\u00a0</p>\\n<p>\\u00a0</p>\\n<p>Braner/Loopco coil systems are the product of continuously evolving development and improvement, all aimed at providing the user with superior product quality, exceptional performance with bullet-proof reliability.\\u00a0 Braner/Loopco coil systems are based on proven technology and time-tested designs augmented with unique state-of-the-art performance enhancing elements and apparatus developed from dozens of patents it\\u2019s been awarded relating to Sitting, Cut-to-Length, Leveling, and Coil Handling products.</p>\\n<p>\\u00a0</p>\\n<p>The strength of Braner/Loopco lies in the extensive experience, know-how, and dedication of its people to equipment performance and customer satisfaction.\\u00a0 Engineers, designers, technicians, and trade craftsmen, all with decades of experience and an obsessive focus on ultimate satisfaction of Braner/Loopco equipment users, coordinate and collaborate to produce the world\\u2019s finest quality coil processing systems supported by the most talented customer service technicians in the industry.</p>\\n&lt;/body&gt;\\n&lt;/html&gt;"}}]	\n&lt;html&gt;\n&lt;head&gt;\n...	1
